    Fstop1 = 0.45;  % First Stopband Frequency
    Fstop2 = 0.55;  % Second Stopband Frequency
    Fpass2 = 0.65;  % Second Passband Frequency
    Apass1 = 1;     % First Passband Ripple (dB)
